import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Navigation from './components/Navigation';
import ONama from './components/ONama';
import Ishrana from './components/Ishrana';
import Trening from './components/Trening';
import Glavna from './components/Glavna';
import Login from './components/Login';
import Register from './components/Register';

const App = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      setIsLoggedIn(true);
    }
  }, []);

  return (
    <Router>
      <div>
        <Navigation />
        <Routes>
          <Route exact path="/" element={isLoggedIn ? <Glavna /> : <Navigate to="/login" />} />
          <Route exact path="/login" element={<Login setIsLoggedIn={setIsLoggedIn} />} />
          <Route exact path="/register" element={<Register />} />
          <Route exact path="/o-nama" element={isLoggedIn ? <ONama /> : <Navigate to="/login" />} />
          <Route exact path="/ishrana" element={isLoggedIn ? <Ishrana /> : <Navigate to="/login" />} />
          <Route exact path="/trening" element={isLoggedIn ? <Trening /> : <Navigate to="/login" />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
